import React, { Component } from "react";
import { Grid, CardMedia, IconButton } from "@material-ui/core";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faChevronLeft,
  faChevronRight
} from "@fortawesome/free-solid-svg-icons";

class Home extends Component {
  render() {
    return (
      <div style={{ flexGrow: 1, background: "blue" }}>
        <img
          src="https://images-na.ssl-images-amazon.com/images/I/7177FQIcHBL._UL1500_.jpg"
          alt="shoe"
          width="100px"
          height="100px"
        />
        <CardMedia image="">
          <Grid
            container
            direction="row"
            style={{
              alignContent: "center",
              alignItems: "center",
              justifyContent: "space-between",
              flexGrow: 1
            }}
          >
            <IconButton>
              <FontAwesomeIcon
                style={{ color: "white" }}
                icon={faChevronLeft}
              />
            </IconButton>
            <IconButton>
              <FontAwesomeIcon
                style={{ color: "white" }}
                icon={faChevronRight}
              />
            </IconButton>
          </Grid>
        </CardMedia>
      </div>
    );
  }
}

// const Home = withStyles(styles)(({ classes }) => (

// ));

export default Home;
